import React from 'react';
import './ButtonLevel.scss'


const ButtonLevel = (props) => {
      const { children, id } = props
      return (
            <div>
                  <button id={id} className='level level_active'>{children}</button>
            </div>
      );
}

export default ButtonLevel;
